import React from 'react';
const rdfetch = require('@rdfjs/fetch');
const Museaal = props => (
    <p>Museaal</p>
);

Museaal.getInitialProps = async function (context) {

    async function getEvent(link)
    {
        const list = await fetch(`${link}`, {
            headers: {
                accept: 'application/rdf+xml'
            }
        }).then(res => res.dataset())
            .catch(err => console.error(err));

        for (const quad of list) {
            //if(quad.predicate.value == "http://opendata.muis.ee/thesaurus/61/11273")
            //console.log("subjekt: " + quad.subject.value + ' predikaat: ' + quad.predicate.value + ' objekt: ' + quad.object.value)
                console.log(quad.object.value);
        }
    }

    const a = ["sinisilm"];
    async function main () {
         try {
             const res = await rdfetch('http://opendata.muis.ee/object/1522095', {
                 headers: {
                     accept: 'application/rdf+xml'
                 }
             })

             const dataset = await res.dataset();

             for (const quad of dataset) {
                 if(quad.predicate.value == "http://www.cidoc-crm.org/cidoc-crm/P12_occurred_in_the_presence_of" )

                //console.log("subjekt: " + quad.subject.value + ' predikaat: ' + quad.predicate.value + ' objekt: ' + quad.object.value)
                     //console.log(' objekt: ' + quad.object.value);
                    var a = getEvent(quad.object.value);
                    console.log(a);
             }
         } catch (err) {
             console.error(err)
         }
     }



     main();

    main();

    return {a};
}; //inital props
export default Museaal
